create table commission
(
    commissionid    int auto_increment
        primary key,
    comdeliverydate date         not null,
    description     varchar(255) not null,
    comemail        varchar(255) not null,
    comfname        varchar(255) null,
    floor           varchar(255) null,
    comhousenumber  int          null,
    image1          blob         not null,
    image2          blob         null,
    image3          blob         null,
    comlname        varchar(255) null,
    comformat1      varchar(255) null,
    comformat2      varchar(255) not null,
    comphonenumber  varchar(255) null,
    street          varchar(255) null,
    subject         varchar(255) not null,
    comzipcode      int          null
);

